import { ADDTASK, DELETETASK, EDITTASK,  FINISHTASK } from "./actiontype"

export const addtodo=(newtodo)=>
{
return {
    type:ADDTASK,
    payload: newtodo
} 

}

export const edittodo=(newedit)=>
{
    return {
        type:EDITTASK,
        payload:newedit
    }

}


export const deletetodo=(del)=>
{   
type:DELETETASK
payload:del
}

export const finshtodo=(finish)=>
{
    type:FINISHTASK;
    payload:finish
}
